INSERT INTO `Product Descriptions` VALUES ('Bamboo thermal ski coat','Youll be the most environmentally conscious skier on the slopes - and the most stylish - wearing our fitted bamboo thermal ski coat, made from organic bamboo with recycled plastic down filling.','Women',45.888),('Cross-back training tank','Our cross-back training tank is made from organic cotton with 10% Lycra for form and support, and a flattering feminine cut. ','Women',9.520),('Grunge skater jeans','Our boy-cut jeans are for men and women who appreciate that skate park fashions arent just for skaters.  Made from the softest and most flexible organic cotton denim.','Unisex',37.090),('Men\'s V-neck T-shirt','Our pre-shrunk organic cotton V-neck T-shirt is the ultimate in comfort and durability, with triple stitching at the collar, sleeves, and waist. So versatile youll want one in every color!','Men',8.890),('Polo shirt','Our pre-shrunk organic cotton polo shirt is perfect for weekend activities, lounging around the house, and casual days at the office. With its triple-stitched sleeves and waistband, our polo has maximum durability.','Men',8.450),('Skater graphic T-shirt','Hip at the skate park or around down, our pre-shrunk organic cotton graphic T-shirt has you covered.','Men',12.990),('Slicker jacket','Wind and rain are no match for our organic bamboo slicker jacket for men and women.  Triple stitched seams, zippered pockets, and a stay-tight hood are just a few features of our best-selling jacket.','Unisex',75.140),('Stretchy dance pants','Whether dancing the samba, mastering a yoga pose, or scaling the climbing wall, our stretchy dance pants, made from 80% organic cotton and 20% Lycra, are the most versatile and comfortable workout pants youll ever have the pleasure of wearing.','Women',22.190),('Thermal fleece jacket','Our thermal organic fleece jacket, is brushed on both sides for ultra softness and warmth. This medium-weight jacket is versatile all year around, and can be worn with layers for the winter season.','Men',52.450),('Thermal vest','Our thermal vest, made from organic bamboo with recycled plastic down filling, is a favorite of both men and women. Youll help the environment, and have a wear-easy piece for many occasions. ','Unisex',39.730),('Ultra-soft tank top','This versatile tank can be worn in the gym, under a blazer, or for a day out in the sun. Made from our patented organic bamboo and cotton mix, our ultra-soft tank never stops feeling soft, even when you forget the fabric softener.','Women',7.450),('V-neck pullover','This organic hemp jersey pullover is perfect in a pinch. Wear for casual days at the office, a game of hoops after work, or running your weekend errands.','Men',11.670),('V-neck sweater','This medium-weight sweater, made from organic knitted cotton and bamboo, is the perfect solution to a chilly night at the campground or a misty walk on the beach.','Men',22.700),('Women\'s V-neck T-shirt','Our pre-shrunk organic cotton t-shirt, with its slightly fitted waist and elegant V-neck is designed to flatter. Youll want one in every color!','Women',8.190);
